project.script:
function tableToCSV() {

    // Variavel global
   var csv_data = [];

   // Verifica quantidade de linhas da tabela
   var rows = document.getElementsByTagName('tr');
   for (var i = 0; i < rows.length; i++) {

       // Armazena dados coluna
       var cols = rows[i].querySelectorAll('td,th');

       // Armazena dados linha
       var csvrow = [];
       for (var j = 0; j < cols.length; j++) {

           // Obtem os dados de texto de cada célula
               // de uma linha e envia para csvrow
           csvrow.push(cols[j].innerHTML.toString().replace('.', ','));
       }

       // Adiciona virgula entre os valores 
       csv_data.push(csvrow.join(";"));
   }

   // Adiciona caracter para pular linha
   csv_data = csv_data.join('\n');

   // chama funcao para download do arquivo
   downloadCSVFile(csv_data);

}

function downloadCSVFile(csv_data) {

   // Cria o arquivo csv
   CSVFile = new Blob([csv_data], {
       type: "text/csv"
   });

   // Cria link temporario
   var temp_link = document.createElement('a');

   // Download arquivo csv
   temp_link.download = "DETALHADO.csv";
   var url = window.URL.createObjectURL(CSVFile);
   temp_link.href = url;

   // O link nao sera exibido
   temp_link.style.display = "none";
   document.body.appendChild(temp_link);

   // gatilho para download automatico
   temp_link.click();
   document.body.removeChild(temp_link);
}

